import React from 'react';
import ClassList from './ClassList';
import Navbar from './Navbar';

const Home = () => {
  return (
    <div>
      <Navbar/>
      <h1>Welcome to the Web Tutoring Home Page</h1>
      <p>This is the home page for web tutoring. Here you can find class listings and apply for classes.</p>
      <ClassList />
    </div>
  );
};

export default Home;
